import React, { Component } from 'react';

class Profile extends Component {

    constructor(props){
        super(props);
        this.state = {
            name : props.name,
            lastName :props.lastName,
            age:props.age,
        };
    }
    render() {
      return (
        <div>
            <p>
                name = {this.state.name +" "+  this.state.lastName}
            </p>
            <p>
                age = {this.state.age}
            </p>
            <button>update details</button>
        </div>
      );
    }
  }

export default Profile;
